"use strict";(self.webpackChunkAoiEngine=self.webpackChunkAoiEngine||[]).push([[86024],{84710:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"guidelines","metadata":{"permalink":"/wikis/guidelines","source":"@site/forums/guidelines.md","title":"Wiki Guidelines","description":"The official Wiki Guidelines.","date":"2023-06-20T08:51:00.000Z","formattedDate":"June 20, 2023","tags":[],"hasTruncateMarker":false,"authors":[{"name":"@faf4a","tags":["Community Manager","Staff"],"title":"Community Manager & Documentation Maintainer","url":"https://discord.com/users/428188716641812481","imageURL":"https://cdn.discordapp.com/avatars/428188716641812481/635c1dca728b68c2fa329dbcb3330204.png","key":"faf4a"}],"frontMatter":{"title":"Wiki Guidelines","description":"The official Wiki Guidelines.","slug":"guidelines","authors":"faf4a","hide_table_of_contents":false,"pagination_next":null,"pagination_prev":null},"nextItem":{"title":"Submit Wiki","permalink":"/wikis/submit"}},"content":"Welcome to the `aoi.js` Wiki! This document outlines the guidelines for contributing to the wiki content.\\n\\n## Purpose of Wikis\\n\\nThe `aoi.js` Wikis serve as a comprehensive resource for users to learn about the functionalities, features, and usage of the `aoi.js` package. It aims to provide clear and concise explanations, examples, and tutorials to help users make the most out of `aoi.js` in their projects.\\n\\n## Contribution Guidelines\\n\\nWe welcome contributions from the community to help improve and expand the `aoi.js` Wiki. To maintain a high-quality and consistent documentation, please adhere to the following guidelines when contributing:\\n\\n1. **Accuracy**: Ensure that the information provided in the Wiki is accurate, up-to-date, and relevant to the current version of `aoi.js`. If you are unsure about any information, consult the official `aoi.js` documentation or reach out to the maintainers.\\n\\n2. **Clarity**: Write in a clear and concise manner, using simple language to explain concepts. Avoid jargon and technical terms unless necessary, and provide explanations or definitions when using them.\\n\\n3. **Organization**: Structure the content logically and use appropriate headings, subheadings, and bullet points to make the information easy to navigate and understand. Consider adding examples, code snippets, and visuals where appropriate to enhance clarity.\\n\\n4. **Consistency**: Maintain consistency in formatting, styling, and terminology throughout the Wiki. Follow the existing conventions and style used in the documentation. If in doubt, refer to the style guide provided in the `aoi.js` repository.\\n\\n5. **Citation**: Whenever referencing external sources or quoting code, make sure to provide proper attribution and citation. Include links or references to the original sources, especially when explaining concepts or providing code examples from other projects.\\n\\n6. **Collaboration**: If you have suggestions, improvements, or corrections for existing content, feel free to open a pull request or create an issue on the `aoi.js` repository. Be respectful and constructive when engaging in discussions or providing feedback.\\n\\n## Conclusion\\n\\nBy following these guidelines, we can collectively create and maintain a valuable resource for the `aoi.js` community. Thank you for your contributions and helping others make the most out of `aoi.js`!\\n\\n:::info Ready to submit?\\n\\nHead to the [submittion Page](./introduction.md)!\\n\\n:::"},{"id":"submit","metadata":{"permalink":"/wikis/submit","source":"@site/forums/introduction.md","title":"Submit Wiki","description":"Submit a Wiki which will then be showcased on this website!","date":"2023-06-20T08:51:00.000Z","formattedDate":"June 20, 2023","tags":[],"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Submit Wiki","description":"Submit a Wiki which will then be showcased on this website!","slug":"submit","hide_table_of_contents":false,"pagination_next":null,"pagination_prev":null},"prevItem":{"title":"Wiki Guidelines","permalink":"/wikis/guidelines"},"nextItem":{"title":"HowGamer command","permalink":"/wikis/posts/howgamer-command-ic9vu7"}},"content":"Welcome to Wikis, this is still **experimental**.\\n\\n:::warning Before Submitting\\n\\nRead the guidelines or your Wiki will possibly get denied for not following the guidelines.\\n\\n:::\\n\\n\\n<div>\\n    <SubmitForm />\\n</div>"},{"id":"/posts/howgamer-command-ic9vu7","metadata":{"permalink":"/wikis/posts/howgamer-command-ic9vu7","source":"@site/forums/posts/howgamer-command-ic9vu7.md","title":"HowGamer command","description":"Checks how gamer you\'re for no reason, It\'s just for fun so.","date":"2023-06-20T08:51:00.000Z","formattedDate":"June 20, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@dodogames","title":"Member","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"}],"frontMatter":{"title":"HowGamer command","description":"Checks how gamer you\'re for no reason, It\'s just for fun so.","authors":{"name":"@dodogames","title":"Member","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Submit Wiki","permalink":"/wikis/submit"},"nextItem":{"title":"Ping Command","permalink":"/wikis/posts/ping"}},"content":"```js\\nmodule.exports = {\\nname: \\"howgamer\\",\\ncode: `$title[how Gamer machine]\\n$description[$username[$mentioned[1;true]] is $random[1;100]% Gamer]\\n$color[Random]\\n$onlyIf[$mentioned[1;true]!=$authorID;{newEmbed:{title:how Gamer machine}{description:you\'re $random[1;100]% Gamer}{color:Random}}]\\n$cooldown[5s; Slow down! Don\'t spam the command!\\nTime left: \\\\`%time%\\\\`]\\n`\\n}\\n```"},{"id":"/posts/ping","metadata":{"permalink":"/wikis/posts/ping","source":"@site/forums/posts/ping.md","title":"Ping Command","description":"This is an example of a ping command","date":"2023-06-20T08:51:00.000Z","formattedDate":"June 20, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@faf4a","tags":["Community Manager","Staff"],"title":"Community Manager & Documentation Maintainer","url":"https://discord.com/users/428188716641812481","imageURL":"https://cdn.discordapp.com/avatars/428188716641812481/635c1dca728b68c2fa329dbcb3330204.png","key":"faf4a"}],"frontMatter":{"title":"Ping Command","description":"This is an example of a ping command","authors":"faf4a","tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"HowGamer command","permalink":"/wikis/posts/howgamer-command-ic9vu7"},"nextItem":{"title":"randomText advanced","permalink":"/wikis/posts/randomtext-advanced-xzyzwx"}},"content":"Lovely ping example.\\n\\n```js\\nmodule.exports = [{\\n  name: \\"ping\\",\\n  code: `\\nMy ping is $pingMS!\\n$reply`\\n}];\\n```\\n\\nEnjoy!"},{"id":"/posts/randomtext-advanced-xzyzwx","metadata":{"permalink":"/wikis/posts/randomtext-advanced-xzyzwx","source":"@site/forums/posts/randomtext-advanced-xzyzwx.md","title":"randomText advanced","description":"A custom function to get random/specified number of words.","date":"2023-06-20T08:51:00.000Z","formattedDate":"June 20, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"Other","permalink":"/wikis/tags/other"}],"hasTruncateMarker":false,"authors":[{"name":"@ahoemi","title":"Member","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"}],"frontMatter":{"title":"randomText advanced","description":"A custom function to get random/specified number of words.","authors":{"name":"@ahoemi","title":"Member","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"},"tags":["v6","Other"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Ping Command","permalink":"/wikis/posts/ping"},"nextItem":{"title":"Roblox group info command","permalink":"/wikis/posts/roblox-group-info-command-ebigj"}},"content":"## Code\\n```js\\nbot.functionManager.createFunction({\\n  name: \\"$randomWord\\",\\n  type: \\"djs\\",\\n  code: async (d) => {\\n  const functionName = \\"$randomWord\\";\\n  const data = d.util.aoiFunc(d);\\n  const [ words, numb = 1 ] = data.inside.splits;\\n\\nif (!words) {\\n let error = `\\\\`\\\\`\\\\`elixir\\\\nRei.js Error\\\\n${functionName}: Words were not provided!\\\\`\\\\`\\\\``\\n  data.result = error\\n} else {\\n  let wordArr = words.split(\':\');\\n  let num = numb > wordArr.length ? wordArr.length : numb;\\n  var randWords = [];\\n  for (let i = 0; i < num; i++) {\\n    let newRandom;\\n    do {\\n      let rand = Math.floor(Math.random() * wordArr.length);\\n      newRandom = wordArr[rand];\\n    } while (randWords.includes(newRandom));\\n    randWords.push(newRandom);\\n  }\\nconst output = randWords.join(\', \')\\ndata.result = output\\n}\\n    return {\\n      code: d.util.setCode(data),\\n    };\\n  }\\n})\\n```\\n### Usage \\n`$randomWord[Hi:Hello:Bye:Sayonara;2]`\\nwill return 2 random words from Hi, Hello, Bye and Sayonara\\n\\n### Where do i use it?\\n- Paste it at bottom of your main file.\\n- You can also edit it and use in handler\\nMention me in support server for any help."},{"id":"/posts/roblox-group-info-command-ebigj","metadata":{"permalink":"/wikis/posts/roblox-group-info-command-ebigj","source":"@site/forums/posts/roblox-group-info-command-ebigj.md","title":"Roblox group info command","description":"Displays info about a roblox group","date":"2023-06-20T08:51:00.000Z","formattedDate":"June 20, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@supreme","tags":["Staff"],"title":"Moderator","url":"https://discord.com/users/964024743172915220","imageURL":"https://cdn.discordapp.com/avatars/964024743172915220/a_153765879b794acfd5fd72ce3f6cd713.gif","key":"supreme"}],"frontMatter":{"title":"Roblox group info command","description":"Displays info about a roblox group","authors":"supreme","tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"randomText advanced","permalink":"/wikis/posts/randomtext-advanced-xzyzwx"}},"content":"```js\\nmodule.exports = {\\n    name: \\"groupinfo\\",\\n    code: `\\n    $title[1;Success!] \\n    $description[> Group ID: $getobjectproperty[id]\\n    > **Group Name:** $getobjectproperty[name]\\n    > **Group Description:** $getobjectproperty[description] $if[$getobjectproperty[description]==;undefined;]\\n    > **Group OwnerId:** $getobjectproperty[owner.username]\\n    > **Group Latest Shout:** $getobjectproperty[shout.body] $if[$getobjectproperty[shout.body]==;undefined;]\\n]\\n    $color[1;#C3A78E]\\n    $footer[1;bob]\\n    $createObject[$jsonRequest[https://groups.roblox.com/v1/groups/$message[1]]]\\n    $argscheck[1;Group id?]\\n    `\\n}\\n```"}]}')}}]);